// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract Vote {

    uint256 public  expiresAt;
    bool public started;
    bool public ended;
    address public verifier;
    

    // userHash is key, userProofs
    mapping (bytes32 => string) private userProofFiles;

    // userHash is key
    mapping (bytes32 => Voter) private verifiedVoters;
    mapping(string => Candidate) public candidates;

     struct Candidate {
        string fullname;
        string partyName;
        string imageIpfsUrl;
        uint256 voteCount;
    }

    struct Voter {
        bool hasVoted;
        bool isVerified;
    }

    constructor(address _verifier) {
        verifier = _verifier;

    }

    event UserProofStored(bytes32 indexed userHash, string ipfsUrl);
    event VoterVerified(bytes32 indexed userHash);
    event CandidateAdded(string name, string partyName, string imageIpfsUrl);
    event VoteSuccesful(bytes32 indexed userHash);
    event VotingStarted(string message);
    event VotingEnded(string message);
    // event Log(bytes32 user, string message);

    modifier checkVoterExists(bytes32 userHash) {
        require(bytes(userProofFiles[userHash]).length == 0, "voter already exists");
        _;
    }



    function storeUserProof(bytes32 userHash, string memory ipfsUrl) public checkVoterExists (userHash) {
        userProofFiles[userHash] = ipfsUrl;
        emit UserProofStored(userHash, ipfsUrl);
    }

    function getUserProof(bytes32 userHash) public view returns (string memory) {
        return userProofFiles[userHash];
    }


    function addVerifiedVoter(bytes32 _userHash) external {
        require(verifiedVoters[_userHash].isVerified, "Voter already verified");
        require(bytes(userProofFiles[_userHash]).length > 0, "Invalid Voter");
        Voter memory voter = Voter({ isVerified: true, hasVoted: false });
        verifiedVoters[_userHash] = voter;
        emit VoterVerified(_userHash);
    }

    
   function isVoterVerified(bytes32 _userHash) external view returns (bool) {
        return verifiedVoters[_userHash].isVerified;
    }

    function storeCandidate(string calldata _fullname, string calldata _partyName, string calldata _url) external {
        require(bytes(candidates[_partyName].fullname).length == 0, "Candidate already registered for party");
        Candidate memory candidate = Candidate({ fullname: _fullname, partyName: _partyName, imageIpfsUrl: _url, voteCount: 0});
        candidates[_partyName] = candidate;
        emit CandidateAdded(_fullname, _partyName, _url);
    }

    function updateVote(bytes32 _userHash, string memory _partyName) internal {
        require(bytes(candidates[_partyName].fullname).length > 0, "Candidate party does not exist");
        require(!verifiedVoters[_userHash].hasVoted, "You have already voted");
        verifiedVoters[_userHash].hasVoted = true;
        candidates[_partyName].voteCount += 1;
    }

    function startVotingProcess(uint256 _duration) external {
        require(!started, "voting has already started");
        expiresAt = block.timestamp + _duration * 1 minutes;
        started = true;
        emit VotingStarted('Voting has started');

    }

    function endVotingProcess() external {
        require(started, "not started");
        require(block.timestamp >= expiresAt, "not ended");
        require(!ended, "voting has already ended");
        ended = true;
        emit VotingEnded('Voting has ended');

    }



    function vote(bytes32 _userHash, string memory _partyName) external {
        require(started, "voting not yet started");
        require(!verifiedVoters[_userHash].hasVoted, "Voter not verified");
        updateVote(_userHash, _partyName);
        emit VoteSuccesful(_userHash);
    }
    

}

